class Solution {
private:
    int convert(vector<int>& map, string num) {
        int ans = 0;
        for (int i = 0; i < num.size(); i++) {
            ans = ans * 10 + map[num[i] - '0'];
        }
        return ans;
    }
public:
    vector<int> sortJumbled(vector<int>& mapping, vector<int>& nums) {
        vector<int> ans{};

        vector<pair<int, int>> arr;
        int t, i = 0;

        for (auto& n: nums) {
            int t = convert(mapping, to_string(n));
            arr.push_back({t, i++});
        }

        sort(arr.begin(), arr.end());

        for (int j = 0; j < nums.size(); j++) {
            int idx = arr[j].second;
            ans.push_back(nums[idx]);
        }
        return ans;
    }
};
